import React, { useState } from "react";
import PropTypes from "prop-types";
import Tabs from "@mui/material/Tabs";
import Tab from "@mui/material/Tab";
import Typography from "@mui/material/Typography";
import Box from "@mui/material/Box";
import BasicCard from "../components/Card";
import { Grid } from "@mui/material";
import Base from "../components/Base";
import { fruits } from "../constants/fruits";
import { vegetables } from "../constants/vegetables";
import { legumes } from "../constants/legumes";

function CustomTabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`simple-tabpanel-${index}`}
      aria-labelledby={`simple-tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box sx={{ p: 3 }}>
          <Typography>{children}</Typography>
        </Box>
      )}
    </div>
  );
}

CustomTabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.number.isRequired,
  value: PropTypes.number.isRequired,
};

function a11yProps(index) {
  return {
    id: `simple-tab-${index}`,
    "aria-controls": `simple-tabpanel-${index}`,
  };
}

export default function Home() {
  const [value, setValue] = useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  const [data, setData] = useState([]);

  return (
    <Base title={"home"}>
      <Box sx={{ width: "100%" }}>
        <Box sx={{ borderBottom: 1, borderColor: "divider" }}>
          <Tabs
            value={value}
            onChange={handleChange}
            aria-label="basic tabs example"
            centered
            sx={{color:"#7FBA00"}}
            indicatorColor="#7FBA00"
            textColor="#7FBA00"

          >
            <Tab label="Frutas" {...a11yProps(0)} />
            <Tab label="Legumes" {...a11yProps(1)} />
            <Tab label="Verduras" {...a11yProps(2)} />
          </Tabs>
        </Box>
        <CustomTabPanel value={value} index={0}>
          <Grid container spacing={1}>
            {fruits.map((item) => {
              return (
                <Grid key={item.id} item lg={4}>
                  <BasicCard item={item} />
                </Grid>
              );
            })}
          </Grid>
        </CustomTabPanel>
        <CustomTabPanel value={value} index={1}>
          <Grid container spacing={1}>
            {vegetables.map((item) => {
              return (
                <Grid key={item.id} item lg={4}>
                  <BasicCard item={item} />
                </Grid>
              );
            })}
          </Grid>
        </CustomTabPanel>
        <CustomTabPanel value={value} index={2}>
          <Grid container spacing={1}>
            {legumes.map((item) => {
              return (
                <Grid key={item.id} item lg={4}>
                  <BasicCard item={item} />
                </Grid>
              );
            })}
          </Grid>
        </CustomTabPanel>
      </Box>
    </Base>
  );
}
